column8:
大流行中の“柄パン”素材、「ストレッチサテン」です。<BR><BR>
ポリウレタン混のパンツ向け素材です。<BR>
前回の「ストレッチチノ」と用途は同じですが、こちらの方が光沢があります。<BR><BR>
こちらの商品、発送まで4～5営業日(土日祝日は除きます)いただいております。<br><br>
染色ロット、ディスプレイ等視聴環境により、実際のカラーと異なる場合がございますので、
予めご了承くださいませ。<br><br>
サイズ：約120cm巾<br>
素材：綿95％ポリウレタン5％(30ストレッチサテン)<br>
<font color="red" size="4">ネコポスは1.5mまで対応可能です！！</font><!-- ここから -->
